import { useLocation, useNavigate } from 'react-router-dom';
import { Patient } from './interfaces';
import { AppointmentTable } from './AppointmentTable';

function PatientDashboard(props: any) {
  const location = useLocation();
  const navigate = useNavigate();
  const patient: Patient = location.state;


  const handleMenuOptionClick = (option: string) => {
    switch (option) {
      case "account":
        // handle account option click
        navigate('/patient-account', { state: patient });
        break;
      case "appointment":
        // handle create appointment option click
        break;
      case "signout":
        // handle sign out option click
        break;
      default:
        break;
    }
  }

  return (
    <div>
      <div>
          <select onChange={(e) => handleMenuOptionClick(e.target.value)}>
            <option value="account">My Account</option>
            <option value="appointment">Create Appointment</option>
            <option value="signout">Sign Out</option>
          </select>
        </div>
      <h2>Welcome {patient.firstName} {patient.lastName}!</h2>
      <AppointmentTable patient={patient} />
    </div>
  );
}

export default PatientDashboard;
